Text:
@khairulaming I wanna share my thoughts on long term

1. Ada kemungkinan banyak owner tak bayar maintenances so JMB tak dapat nak buat pembaikkan.

2. Interfloor - leaking. Biasanya kalau interfloor leaking, owner atas kena repair leaking. Tapi kalau dpt rumah yang owner tak tahu kemana? ü§∑üèº‚Äç‚ôÄÔ∏è

Translated Text:
@khairulaming I want to share my thoughts on long term

1. There is a possibility that many owners don't pay for maintenance so JMB can't make repairs.

2. Interfloor - leaking. Usually, if the interfloor is leaking, the owner will have to repair the leak. But if you get a house where the owner doesn't know where? ü§∑üèº‚Äç‚ôÄÔ∏è

Text:
@khairulaming 1. Periksa keadaan unit sebelum beli. New dev usually ada byk masalah defect &amp; dev lambat repair. Kena kejar2, bising2 selalu.
2. Kalau beli drp org lain, tanya habis2 bil elektrik, air, cukai, dsbg sbb lepas beli kamu yg kena byr bukan owner lama.
3. Ambil peguam sendiri.

Translated Text:
@khairulaming 1. Check the condition of the unit before buying. New dev usually has a lot of defect problems &amp; dev is slow to repair. Got chased, always noisy.
2. If you buy from someone else, ask for the electricity, water, tax, etc. bills because after buying you are the one who has to pay, not the old owner.
3. Get your own lawyer.

Text:
